package main

import (
    "sort"
)

func ByLength(arr []int) []string {
    // Filter the array to keep only values between 1 and 9
    filtered := []int{}
    for _, num := range arr {
        if num >= 1 && num <= 9 {
            filtered = append(filtered, num)
        }
    }

    // Sort the filtered array
    sort.Ints(filtered)

    // Reverse the sorted array
    for i, j := 0, len(filtered)-1; i < j; i, j = i+1, j-1 {
        filtered[i], filtered[j] = filtered[j], filtered[i]
    }

    // Map digits to their corresponding names
    names := []string{"", "One", "Two", "Three", "Four", "Five", "Six", "Seven", "Eight", "Nine"}
    result := []string{}
    for _, num := range filtered {
        if num >= 1 && num <= 9 {
            result = append(result, names[num])
        }
    }

    return result
}
